e_type_int32(Value, Bin)
    when 0 =< Value, Value =< 127 ->
    <<Bin/binary, Value>>;
e_type_int32(Value, Bin) ->
    <<N:64/unsigned-native>> = <<Value:64/signed-native>>,
    e_varint(N, Bin).

e_type_int64(Value, Bin)
    when 0 =< Value, Value =< 127 ->
    <<Bin/binary, Value>>;
e_type_int64(Value, Bin) ->
    <<N:64/unsigned-native>> = <<Value:64/signed-native>>,
    e_varint(N, Bin).

e_type_bool(true, Bin) -> <<Bin/binary, 1>>;
e_type_bool(false, Bin) -> <<Bin/binary, 0>>;
e_type_bool(1, Bin) -> <<Bin/binary, 1>>;
e_type_bool(0, Bin) -> <<Bin/binary, 0>>.

e_type_string(S, Bin) ->
    Utf8 = unicode:characters_to_binary(S),
    Bin2 = e_varint(byte_size(Utf8), Bin),
    <<Bin2/binary, Utf8/binary>>.

e_type_bytes(Bytes, Bin) when is_binary(Bytes) ->
    Bin2 = e_varint(byte_size(Bytes), Bin),
    <<Bin2/binary, Bytes/binary>>;
e_type_bytes(Bytes, Bin) when is_list(Bytes) ->
    BytesBin = iolist_to_binary(Bytes),
    Bin2 = e_varint(byte_size(BytesBin), Bin),
    <<Bin2/binary, BytesBin/binary>>.

e_type_fixed32(Value, Bin) ->
    <<Bin/binary, Value:32/little>>.

e_type_fixed64(Value, Bin) ->
    <<Bin/binary, Value:64/little>>.

e_varint(N, Bin) when N =< 127 -> <<Bin/binary, N>>;
e_varint(N, Bin) ->
    Bin2 = <<Bin/binary, (N band 127 bor 128)>>,
    e_varint(N bsr 7, Bin2).



decode_msg(Bin, MsgName) when is_binary(Bin) ->
    decode_msg(Bin, MsgName, []).

decode_msg(Bin, MsgName, Opts) when is_binary(Bin) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      'KVPair' -> d_msg_KVPair(Bin, TrUserData);
      'ConfigResp' -> d_msg_ConfigResp(Bin, TrUserData);
      'X509UpdateReq' -> d_msg_X509UpdateReq(Bin, TrUserData);
      'LoginReq' -> d_msg_LoginReq(Bin, TrUserData);
      'LightingCtrl' -> d_msg_LightingCtrl(Bin, TrUserData);
      'LightingClearSchedule' ->
	  d_msg_LightingClearSchedule(Bin, TrUserData);
      'AstronomicalEvent' ->
	  d_msg_AstronomicalEvent(Bin, TrUserData);
      'LightingAstronomicalEvent' ->
	  d_msg_LightingAstronomicalEvent(Bin, TrUserData);
      'CalendarEvent' -> d_msg_CalendarEvent(Bin, TrUserData);
      'LightingScheduledEvent' ->
	  d_msg_LightingScheduledEvent(Bin, TrUserData);
      'LightingSetAuto' ->
	  d_msg_LightingSetAuto(Bin, TrUserData);
      'LightingForceState' ->
	  d_msg_LightingForceState(Bin, TrUserData);
      'GpsActionRsp' -> d_msg_GpsActionRsp(Bin, TrUserData);
      'GpsActionReq' -> d_msg_GpsActionReq(Bin, TrUserData);
      'GpsSample' -> d_msg_GpsSample(Bin, TrUserData);
      'SensorSampleReq' ->
	  d_msg_SensorSampleReq(Bin, TrUserData);
      'TimeResp' -> d_msg_TimeResp(Bin, TrUserData);
      'TimeReq' -> d_msg_TimeReq(Bin, TrUserData);
      'VideoUploadResp' ->
	  d_msg_VideoUploadResp(Bin, TrUserData);
      'VideoUploadReq' ->
	  d_msg_VideoUploadReq(Bin, TrUserData);
      'SensorSample' -> d_msg_SensorSample(Bin, TrUserData);
      'DeviceActionReq' ->
	  d_msg_DeviceActionReq(Bin, TrUserData);
      'DeviceAlarm' -> d_msg_DeviceAlarm(Bin, TrUserData);
      'SoftwareUpdateReq' ->
	  d_msg_SoftwareUpdateReq(Bin, TrUserData);
      'ConfigRespDone' ->
	  d_msg_ConfigRespDone(Bin, TrUserData);
      'UnusedConfigReq' ->
	  d_msg_UnusedConfigReq(Bin, TrUserData);
      'LoginResp' -> d_msg_LoginResp(Bin, TrUserData);
      'Envelope' -> d_msg_Envelope(Bin, TrUserData);
      'ErrorResp' -> d_msg_ErrorResp(Bin, TrUserData)
    end.



d_msg_KVPair(Bin, TrUserData) ->
    dfp_read_field_def_KVPair(Bin, 0, 0,
			      id(undefined, TrUserData),
			      id(undefined, TrUserData),
			      id(undefined, TrUserData),
			      id(undefined, TrUserData), TrUserData).

dfp_read_field_def_KVPair(<<10, Rest/binary>>, Z1, Z2,
			  F1, F2, F3, F4, TrUserData) ->
    d_field_KVPair_key(Rest, Z1, Z2, F1, F2, F3, F4,
		       TrUserData);
dfp_read_field_def_KVPair(<<18, Rest/binary>>, Z1, Z2,
			  F1, F2, F3, F4, TrUserData) ->
    d_field_KVPair_sValue(Rest, Z1, Z2, F1, F2, F3, F4,
			  TrUserData);
dfp_read_field_def_KVPair(<<24, Rest/binary>>, Z1, Z2,
			  F1, F2, F3, F4, TrUserData) ->
    d_field_KVPair_lValue(Rest, Z1, Z2, F1, F2, F3, F4,
			  TrUserData);
dfp_read_field_def_KVPair(<<32, Rest/binary>>, Z1, Z2,
			  F1, F2, F3, F4, TrUserData) ->
    d_field_KVPair_bValue(Rest, Z1, Z2, F1, F2, F3, F4,
			  TrUserData);
dfp_read_field_def_KVPair(<<>>, 0, 0, F1, F2, F3, F4,
			  _) ->
    #'KVPair'{key = F1, sValue = F2, lValue = F3,
	      bValue = F4};
dfp_read_field_def_KVPair(Other, Z1, Z2, F1, F2, F3, F4,
			  TrUserData) ->
    dg_read_field_def_KVPair(Other, Z1, Z2, F1, F2, F3, F4,
			     TrUserData).

dg_read_field_def_KVPair(<<1:1, X:7, Rest/binary>>, N,
			 Acc, F1, F2, F3, F4, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_KVPair(Rest, N + 7, X bsl N + Acc, F1,
			     F2, F3, F4, TrUserData);
dg_read_field_def_KVPair(<<0:1, X:7, Rest/binary>>, N,
			 Acc, F1, F2, F3, F4, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      10 ->
	  d_field_KVPair_key(Rest, 0, 0, F1, F2, F3, F4,
			     TrUserData);
      18 ->
	  d_field_KVPair_sValue(Rest, 0, 0, F1, F2, F3, F4,
				TrUserData);
      24 ->
	  d_field_KVPair_lValue(Rest, 0, 0, F1, F2, F3, F4,
				TrUserData);
      32 ->
	  d_field_KVPair_bValue(Rest, 0, 0, F1, F2, F3, F4,
				TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_KVPair(Rest, 0, 0, F1, F2, F3, F4,
				   TrUserData);
	    1 ->
		skip_64_KVPair(Rest, 0, 0, F1, F2, F3, F4, TrUserData);
	    2 ->
		skip_length_delimited_KVPair(Rest, 0, 0, F1, F2, F3, F4,
					     TrUserData);
	    3 ->
		skip_group_KVPair(Rest, Key bsr 3, 0, F1, F2, F3, F4,
				  TrUserData);
	    5 ->
		skip_32_KVPair(Rest, 0, 0, F1, F2, F3, F4, TrUserData)
	  end
    end;
dg_read_field_def_KVPair(<<>>, 0, 0, F1, F2, F3, F4,
			 _) ->
    #'KVPair'{key = F1, sValue = F2, lValue = F3,
	      bValue = F4}.

d_field_KVPair_key(<<1:1, X:7, Rest/binary>>, N, Acc,
		   F1, F2, F3, F4, TrUserData)
    when N < 57 ->
    d_field_KVPair_key(Rest, N + 7, X bsl N + Acc, F1, F2,
		       F3, F4, TrUserData);
d_field_KVPair_key(<<0:1, X:7, Rest/binary>>, N, Acc, _,
		   F2, F3, F4, TrUserData) ->
    Len = X bsl N + Acc,
    <<Bytes:Len/binary, Rest2/binary>> = Rest,
    NewFValue = binary:copy(Bytes),
    dfp_read_field_def_KVPair(Rest2, 0, 0, NewFValue, F2,
			      F3, F4, TrUserData).


d_field_KVPair_sValue(<<1:1, X:7, Rest/binary>>, N, Acc,
		      F1, F2, F3, F4, TrUserData)
    when N < 57 ->
    d_field_KVPair_sValue(Rest, N + 7, X bsl N + Acc, F1,
			  F2, F3, F4, TrUserData);
d_field_KVPair_sValue(<<0:1, X:7, Rest/binary>>, N, Acc,
		      F1, _, F3, F4, TrUserData) ->
    Len = X bsl N + Acc,
    <<Bytes:Len/binary, Rest2/binary>> = Rest,
    NewFValue = binary:copy(Bytes),
    dfp_read_field_def_KVPair(Rest2, 0, 0, F1, NewFValue,
			      F3, F4, TrUserData).


d_field_KVPair_lValue(<<1:1, X:7, Rest/binary>>, N, Acc,
		      F1, F2, F3, F4, TrUserData)
    when N < 57 ->
    d_field_KVPair_lValue(Rest, N + 7, X bsl N + Acc, F1,
			  F2, F3, F4, TrUserData);
d_field_KVPair_lValue(<<0:1, X:7, Rest/binary>>, N, Acc,
		      F1, F2, _, F4, TrUserData) ->
    <<NewFValue:64/signed-native>> = <<(X bsl N +
					  Acc):64/unsigned-native>>,
    dfp_read_field_def_KVPair(Rest, 0, 0, F1, F2, NewFValue,
			      F4, TrUserData).


d_field_KVPair_bValue(<<1:1, X:7, Rest/binary>>, N, Acc,
		      F1, F2, F3, F4, TrUserData)
    when N < 57 ->
    d_field_KVPair_bValue(Rest, N + 7, X bsl N + Acc, F1,
			  F2, F3, F4, TrUserData);
d_field_KVPair_bValue(<<0:1, X:7, Rest/binary>>, N, Acc,
		      F1, F2, F3, _, TrUserData) ->
    NewFValue = X bsl N + Acc =/= 0,
    dfp_read_field_def_KVPair(Rest, 0, 0, F1, F2, F3,
			      NewFValue, TrUserData).


skip_varint_KVPair(<<1:1, _:7, Rest/binary>>, Z1, Z2,
		   F1, F2, F3, F4, TrUserData) ->
    skip_varint_KVPair(Rest, Z1, Z2, F1, F2, F3, F4,
		       TrUserData);
skip_varint_KVPair(<<0:1, _:7, Rest/binary>>, Z1, Z2,
		   F1, F2, F3, F4, TrUserData) ->
    dfp_read_field_def_KVPair(Rest, Z1, Z2, F1, F2, F3, F4,
			      TrUserData).


skip_length_delimited_KVPair(<<1:1, X:7, Rest/binary>>,
			     N, Acc, F1, F2, F3, F4, TrUserData)
    when N < 57 ->
    skip_length_delimited_KVPair(Rest, N + 7, X bsl N + Acc,
				 F1, F2, F3, F4, TrUserData);
skip_length_delimited_KVPair(<<0:1, X:7, Rest/binary>>,
			     N, Acc, F1, F2, F3, F4, TrUserData) ->
    Length = X bsl N + Acc,
    <<_:Length/binary, Rest2/binary>> = Rest,
    dfp_read_field_def_KVPair(Rest2, 0, 0, F1, F2, F3, F4,
			      TrUserData).


skip_group_KVPair(Bin, FNum, Z2, F1, F2, F3, F4,
		  TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    dfp_read_field_def_KVPair(Rest, 0, Z2, F1, F2, F3, F4,
			      TrUserData).


skip_32_KVPair(<<_:32, Rest/binary>>, Z1, Z2, F1, F2,
	       F3, F4, TrUserData) ->
    dfp_read_field_def_KVPair(Rest, Z1, Z2, F1, F2, F3, F4,
			      TrUserData).


skip_64_KVPair(<<_:64, Rest/binary>>, Z1, Z2, F1, F2,
	       F3, F4, TrUserData) ->
    dfp_read_field_def_KVPair(Rest, Z1, Z2, F1, F2, F3, F4,
			      TrUserData).


d_msg_ConfigResp(Bin, TrUserData) ->
    dfp_read_field_def_ConfigResp(Bin, 0, 0,
				  id(undefined, TrUserData), TrUserData).

dfp_read_field_def_ConfigResp(<<10, Rest/binary>>, Z1,
			      Z2, F1, TrUserData) ->
    d_field_ConfigResp_pair(Rest, Z1, Z2, F1, TrUserData);
dfp_read_field_def_ConfigResp(<<>>, 0, 0, F1, _) ->
    #'ConfigResp'{pair = F1};
dfp_read_field_def_ConfigResp(Other, Z1, Z2, F1,
			      TrUserData) ->
    dg_read_field_def_ConfigResp(Other, Z1, Z2, F1,
				 TrUserData).

dg_read_field_def_ConfigResp(<<1:1, X:7, Rest/binary>>,
			     N, Acc, F1, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_ConfigResp(Rest, N + 7, X bsl N + Acc,
				 F1, TrUserData);
dg_read_field_def_ConfigResp(<<0:1, X:7, Rest/binary>>,
			     N, Acc, F1, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      10 ->
	  d_field_ConfigResp_pair(Rest, 0, 0, F1, TrUserData);
      _ ->
	  case Key band 7 of
	    0 -> skip_varint_ConfigResp(Rest, 0, 0, F1, TrUserData);
	    1 -> skip_64_ConfigResp(Rest, 0, 0, F1, TrUserData);
	    2 ->
		skip_length_delimited_ConfigResp(Rest, 0, 0, F1,
						 TrUserData);
	    3 ->
		skip_group_ConfigResp(Rest, Key bsr 3, 0, F1,
				      TrUserData);
	    5 -> skip_32_ConfigResp(Rest, 0, 0, F1, TrUserData)
	  end
    end;
dg_read_field_def_ConfigResp(<<>>, 0, 0, F1, _) ->
    #'ConfigResp'{pair = F1}.

d_field_ConfigResp_pair(<<1:1, X:7, Rest/binary>>, N,
			Acc, F1, TrUserData)
    when N < 57 ->
    d_field_ConfigResp_pair(Rest, N + 7, X bsl N + Acc, F1,
			    TrUserData);
d_field_ConfigResp_pair(<<0:1, X:7, Rest/binary>>, N,
			Acc, F1, TrUserData) ->
    Len = X bsl N + Acc,
    <<Bs:Len/binary, Rest2/binary>> = Rest,
    NewFValue = id(d_msg_KVPair(Bs, TrUserData),
		   TrUserData),
    dfp_read_field_def_ConfigResp(Rest2, 0, 0,
				  if F1 == undefined -> NewFValue;
				     true ->
					 merge_msg_KVPair(F1, NewFValue,
							  TrUserData)
				  end,
				  TrUserData).


skip_varint_ConfigResp(<<1:1, _:7, Rest/binary>>, Z1,
		       Z2, F1, TrUserData) ->
    skip_varint_ConfigResp(Rest, Z1, Z2, F1, TrUserData);
skip_varint_ConfigResp(<<0:1, _:7, Rest/binary>>, Z1,
		       Z2, F1, TrUserData) ->
    dfp_read_field_def_ConfigResp(Rest, Z1, Z2, F1,
				  TrUserData).


skip_length_delimited_ConfigResp(<<1:1, X:7,
				   Rest/binary>>,
				 N, Acc, F1, TrUserData)
    when N < 57 ->
    skip_length_delimited_ConfigResp(Rest, N + 7,
				     X bsl N + Acc, F1, TrUserData);
skip_length_delimited_ConfigResp(<<0:1, X:7,
				   Rest/binary>>,
				 N, Acc, F1, TrUserData) ->
    Length = X bsl N + Acc,
    <<_:Length/binary, Rest2/binary>> = Rest,
    dfp_read_field_def_ConfigResp(Rest2, 0, 0, F1,
				  TrUserData).


skip_group_ConfigResp(Bin, FNum, Z2, F1, TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    dfp_read_field_def_ConfigResp(Rest, 0, Z2, F1,
				  TrUserData).


