				N, Acc, F1, F2, F3, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      10 ->
	  d_field_X509UpdateReq_x509UpdateURL(Rest, 0, 0, F1, F2,
					      F3, TrUserData);
      16 ->
	  d_field_X509UpdateReq_x509Update(Rest, 0, 0, F1, F2, F3,
					   TrUserData);
      24 ->
	  d_field_X509UpdateReq_httpsPort(Rest, 0, 0, F1, F2, F3,
					  TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_X509UpdateReq(Rest, 0, 0, F1, F2, F3,
					  TrUserData);
	    1 ->
		skip_64_X509UpdateReq(Rest, 0, 0, F1, F2, F3,
				      TrUserData);
	    2 ->
		skip_length_delimited_X509UpdateReq(Rest, 0, 0, F1, F2,
						    F3, TrUserData);
	    3 ->
		skip_group_X509UpdateReq(Rest, Key bsr 3, 0, F1, F2, F3,
					 TrUserData);
	    5 ->
		skip_32_X509UpdateReq(Rest, 0, 0, F1, F2, F3,
				      TrUserData)
	  end
    end;
