dfp_read_field_def_LightingCtrl(<<8, Rest/binary>>, Z1,
				Z2, F1, F2, F3, F4, TrUserData) ->
    d_field_LightingCtrl_pri(Rest, Z1, Z2, F1, F2, F3, F4,
			     TrUserData);
