	    3 ->
		skip_group_AstronomicalEvent(Rest, Key bsr 3, 0, F1, F2,
					     F3, F4, F5, F6, F7, TrUserData);
	    5 ->
		skip_32_AstronomicalEvent(Rest, 0, 0, F1, F2, F3, F4,
					  F5, F6, F7, TrUserData)
	  end
    end;
