    skip_varint_Envelope(Rest, Z1, Z2, F1, F2, F3, F4, F5,
			 F6, F7, F8, F9, F10, F11, F12, F13, F14, F15, F16, F17,
			 F18, F19, F20, F21, F22, F23, TrUserData);
skip_varint_Envelope(<<0:1, _:7, Rest/binary>>, Z1, Z2,
		     F1, F2, F3, F4, F5, F6, F7, F8, F9, F10, F11, F12, F13,
		     F14, F15, F16, F17, F18, F19, F20, F21, F22, F23,
		     TrUserData) ->
    dfp_read_field_def_Envelope(Rest, Z1, Z2, F1, F2, F3,
				F4, F5, F6, F7, F8, F9, F10, F11, F12, F13, F14,
				F15, F16, F17, F18, F19, F20, F21, F22, F23,
				TrUserData).


skip_length_delimited_Envelope(<<1:1, X:7,
				 Rest/binary>>,
			       N, Acc, F1, F2, F3, F4, F5, F6, F7, F8, F9, F10,
			       F11, F12, F13, F14, F15, F16, F17, F18, F19, F20,
			       F21, F22, F23, TrUserData)
    when N < 57 ->
    skip_length_delimited_Envelope(Rest, N + 7,
				   X bsl N + Acc, F1, F2, F3, F4, F5, F6, F7,
				   F8, F9, F10, F11, F12, F13, F14, F15, F16,
				   F17, F18, F19, F20, F21, F22, F23,
				   TrUserData);
skip_length_delimited_Envelope(<<0:1, X:7,
				 Rest/binary>>,
			       N, Acc, F1, F2, F3, F4, F5, F6, F7, F8, F9, F10,
			       F11, F12, F13, F14, F15, F16, F17, F18, F19, F20,
			       F21, F22, F23, TrUserData) ->
    Length = X bsl N + Acc,
    <<_:Length/binary, Rest2/binary>> = Rest,
    dfp_read_field_def_Envelope(Rest2, 0, 0, F1, F2, F3, F4,
				F5, F6, F7, F8, F9, F10, F11, F12, F13, F14,
				F15, F16, F17, F18, F19, F20, F21, F22, F23,
				TrUserData).


skip_group_Envelope(Bin, FNum, Z2, F1, F2, F3, F4, F5,
		    F6, F7, F8, F9, F10, F11, F12, F13, F14, F15, F16, F17,
		    F18, F19, F20, F21, F22, F23, TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    dfp_read_field_def_Envelope(Rest, 0, Z2, F1, F2, F3, F4,
				F5, F6, F7, F8, F9, F10, F11, F12, F13, F14,
				F15, F16, F17, F18, F19, F20, F21, F22, F23,
				TrUserData).


skip_32_Envelope(<<_:32, Rest/binary>>, Z1, Z2, F1, F2,
		 F3, F4, F5, F6, F7, F8, F9, F10, F11, F12, F13, F14,
		 F15, F16, F17, F18, F19, F20, F21, F22, F23,
		 TrUserData) ->
    dfp_read_field_def_Envelope(Rest, Z1, Z2, F1, F2, F3,
				F4, F5, F6, F7, F8, F9, F10, F11, F12, F13, F14,
				F15, F16, F17, F18, F19, F20, F21, F22, F23,
				TrUserData).


skip_64_Envelope(<<_:64, Rest/binary>>, Z1, Z2, F1, F2,
		 F3, F4, F5, F6, F7, F8, F9, F10, F11, F12, F13, F14,
		 F15, F16, F17, F18, F19, F20, F21, F22, F23,
		 TrUserData) ->
    dfp_read_field_def_Envelope(Rest, Z1, Z2, F1, F2, F3,
				F4, F5, F6, F7, F8, F9, F10, F11, F12, F13, F14,
				F15, F16, F17, F18, F19, F20, F21, F22, F23,
				TrUserData).


d_msg_ErrorResp(Bin, TrUserData) ->
    dfp_read_field_def_ErrorResp(Bin, 0, 0,
				 id(undefined, TrUserData), TrUserData).

dfp_read_field_def_ErrorResp(<<10, Rest/binary>>, Z1,
			     Z2, F1, TrUserData) ->
    d_field_ErrorResp_message(Rest, Z1, Z2, F1, TrUserData);
dfp_read_field_def_ErrorResp(<<>>, 0, 0, F1, _) ->
    #'ErrorResp'{message = F1};
dfp_read_field_def_ErrorResp(Other, Z1, Z2, F1,
			     TrUserData) ->
    dg_read_field_def_ErrorResp(Other, Z1, Z2, F1,
				TrUserData).

dg_read_field_def_ErrorResp(<<1:1, X:7, Rest/binary>>,
			    N, Acc, F1, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_ErrorResp(Rest, N + 7, X bsl N + Acc,
				F1, TrUserData);
dg_read_field_def_ErrorResp(<<0:1, X:7, Rest/binary>>,
			    N, Acc, F1, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      10 ->
	  d_field_ErrorResp_message(Rest, 0, 0, F1, TrUserData);
      _ ->
	  case Key band 7 of
	    0 -> skip_varint_ErrorResp(Rest, 0, 0, F1, TrUserData);
	    1 -> skip_64_ErrorResp(Rest, 0, 0, F1, TrUserData);
	    2 ->
		skip_length_delimited_ErrorResp(Rest, 0, 0, F1,
						TrUserData);
	    3 ->
		skip_group_ErrorResp(Rest, Key bsr 3, 0, F1,
				     TrUserData);
	    5 -> skip_32_ErrorResp(Rest, 0, 0, F1, TrUserData)
	  end
    end;
dg_read_field_def_ErrorResp(<<>>, 0, 0, F1, _) ->
    #'ErrorResp'{message = F1}.

d_field_ErrorResp_message(<<1:1, X:7, Rest/binary>>, N,
			  Acc, F1, TrUserData)
    when N < 57 ->
    d_field_ErrorResp_message(Rest, N + 7, X bsl N + Acc,
			      F1, TrUserData);
d_field_ErrorResp_message(<<0:1, X:7, Rest/binary>>, N,
			  Acc, _, TrUserData) ->
    Len = X bsl N + Acc,
    <<Bytes:Len/binary, Rest2/binary>> = Rest,
    NewFValue = binary:copy(Bytes),
    dfp_read_field_def_ErrorResp(Rest2, 0, 0, NewFValue,
				 TrUserData).


skip_varint_ErrorResp(<<1:1, _:7, Rest/binary>>, Z1, Z2,
		      F1, TrUserData) ->
    skip_varint_ErrorResp(Rest, Z1, Z2, F1, TrUserData);
skip_varint_ErrorResp(<<0:1, _:7, Rest/binary>>, Z1, Z2,
		      F1, TrUserData) ->
    dfp_read_field_def_ErrorResp(Rest, Z1, Z2, F1,
				 TrUserData).


skip_length_delimited_ErrorResp(<<1:1, X:7,
				  Rest/binary>>,
				N, Acc, F1, TrUserData)
    when N < 57 ->
    skip_length_delimited_ErrorResp(Rest, N + 7,
				    X bsl N + Acc, F1, TrUserData);
skip_length_delimited_ErrorResp(<<0:1, X:7,
				  Rest/binary>>,
				N, Acc, F1, TrUserData) ->
    Length = X bsl N + Acc,
    <<_:Length/binary, Rest2/binary>> = Rest,
    dfp_read_field_def_ErrorResp(Rest2, 0, 0, F1,
				 TrUserData).


skip_group_ErrorResp(Bin, FNum, Z2, F1, TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    dfp_read_field_def_ErrorResp(Rest, 0, Z2, F1,
				 TrUserData).


skip_32_ErrorResp(<<_:32, Rest/binary>>, Z1, Z2, F1,
		  TrUserData) ->
    dfp_read_field_def_ErrorResp(Rest, Z1, Z2, F1,
				 TrUserData).


skip_64_ErrorResp(<<_:64, Rest/binary>>, Z1, Z2, F1,
		  TrUserData) ->
    dfp_read_field_def_ErrorResp(Rest, Z1, Z2, F1,
				 TrUserData).




