read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).


merge_msgs(Prev, New) -> merge_msgs(Prev, New, []).

merge_msgs(Prev, New, Opts)
    when element(1, Prev) =:= element(1, New) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case Prev of
      #'KVPair'{} -> merge_msg_KVPair(Prev, New, TrUserData);
      #'ConfigResp'{} ->
	  merge_msg_ConfigResp(Prev, New, TrUserData);
      #'X509UpdateReq'{} ->
	  merge_msg_X509UpdateReq(Prev, New, TrUserData);
      #'LoginReq'{} ->
	  merge_msg_LoginReq(Prev, New, TrUserData);
      #'LightingCtrl'{} ->
	  merge_msg_LightingCtrl(Prev, New, TrUserData);
      #'LightingClearSchedule'{} ->
	  merge_msg_LightingClearSchedule(Prev, New, TrUserData);
      #'AstronomicalEvent'{} ->
	  merge_msg_AstronomicalEvent(Prev, New, TrUserData);
      #'LightingAstronomicalEvent'{} ->
	  merge_msg_LightingAstronomicalEvent(Prev, New,
					      TrUserData);
      #'CalendarEvent'{} ->
	  merge_msg_CalendarEvent(Prev, New, TrUserData);
      #'LightingScheduledEvent'{} ->
	  merge_msg_LightingScheduledEvent(Prev, New, TrUserData);
      #'LightingSetAuto'{} ->
	  merge_msg_LightingSetAuto(Prev, New, TrUserData);
      #'LightingForceState'{} ->
	  merge_msg_LightingForceState(Prev, New, TrUserData);
      #'GpsActionRsp'{} ->
	  merge_msg_GpsActionRsp(Prev, New, TrUserData);
      #'GpsActionReq'{} ->
	  merge_msg_GpsActionReq(Prev, New, TrUserData);
      #'GpsSample'{} ->
	  merge_msg_GpsSample(Prev, New, TrUserData);
      #'SensorSampleReq'{} ->
	  merge_msg_SensorSampleReq(Prev, New, TrUserData);
      #'TimeResp'{} ->
	  merge_msg_TimeResp(Prev, New, TrUserData);
      #'TimeReq'{} ->
	  merge_msg_TimeReq(Prev, New, TrUserData);
      #'VideoUploadResp'{} ->
	  merge_msg_VideoUploadResp(Prev, New, TrUserData);
      #'VideoUploadReq'{} ->
	  merge_msg_VideoUploadReq(Prev, New, TrUserData);
      #'SensorSample'{} ->
	  merge_msg_SensorSample(Prev, New, TrUserData);
      #'DeviceActionReq'{} ->
	  merge_msg_DeviceActionReq(Prev, New, TrUserData);
      #'DeviceAlarm'{} ->
	  merge_msg_DeviceAlarm(Prev, New, TrUserData);
      #'SoftwareUpdateReq'{} ->
	  merge_msg_SoftwareUpdateReq(Prev, New, TrUserData);
      #'ConfigRespDone'{} ->
	  merge_msg_ConfigRespDone(Prev, New, TrUserData);
      #'UnusedConfigReq'{} ->
	  merge_msg_UnusedConfigReq(Prev, New, TrUserData);
      #'LoginResp'{} ->
	  merge_msg_LoginResp(Prev, New, TrUserData);
      #'Envelope'{} ->
	  merge_msg_Envelope(Prev, New, TrUserData);
      #'ErrorResp'{} ->
	  merge_msg_ErrorResp(Prev, New, TrUserData)
    end.

merge_msg_KVPair(#'KVPair'{sValue = PFsValue,
			   lValue = PFlValue, bValue = PFbValue},
		 #'KVPair'{key = NFkey, sValue = NFsValue,
			   lValue = NFlValue, bValue = NFbValue},
		 _) ->
    #'KVPair'{key = NFkey,
	      sValue =
		  if NFsValue =:= undefined -> PFsValue;
		     true -> NFsValue
		  end,
	      lValue =
		  if NFlValue =:= undefined -> PFlValue;
		     true -> NFlValue
		  end,
	      bValue =
		  if NFbValue =:= undefined -> PFbValue;
		     true -> NFbValue
		  end}.

merge_msg_ConfigResp(#'ConfigResp'{pair = PFpair},
		     #'ConfigResp'{pair = NFpair}, TrUserData) ->
    #'ConfigResp'{pair =
		      if PFpair /= undefined, NFpair /= undefined ->
			     merge_msg_KVPair(PFpair, NFpair, TrUserData);
			 PFpair == undefined -> NFpair;
			 NFpair == undefined -> PFpair
		      end}.

