verify_msg(Msg) -> verify_msg(Msg, []).

verify_msg(Msg, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case Msg of
      #'KVPair'{} ->
	  v_msg_KVPair(Msg, ['KVPair'], TrUserData);
      #'ConfigResp'{} ->
	  v_msg_ConfigResp(Msg, ['ConfigResp'], TrUserData);
      #'X509UpdateReq'{} ->
	  v_msg_X509UpdateReq(Msg, ['X509UpdateReq'], TrUserData);
      #'LoginReq'{} ->
	  v_msg_LoginReq(Msg, ['LoginReq'], TrUserData);
      #'LightingCtrl'{} ->
	  v_msg_LightingCtrl(Msg, ['LightingCtrl'], TrUserData);
      #'LightingClearSchedule'{} ->
	  v_msg_LightingClearSchedule(Msg,
				      ['LightingClearSchedule'], TrUserData);
      #'AstronomicalEvent'{} ->
	  v_msg_AstronomicalEvent(Msg, ['AstronomicalEvent'],
				  TrUserData);
      #'LightingAstronomicalEvent'{} ->
	  v_msg_LightingAstronomicalEvent(Msg,
					  ['LightingAstronomicalEvent'],
					  TrUserData);
      #'CalendarEvent'{} ->
	  v_msg_CalendarEvent(Msg, ['CalendarEvent'], TrUserData);
      #'LightingScheduledEvent'{} ->
	  v_msg_LightingScheduledEvent(Msg,
				       ['LightingScheduledEvent'], TrUserData);
      #'LightingSetAuto'{} ->
	  v_msg_LightingSetAuto(Msg, ['LightingSetAuto'],
				TrUserData);
      #'LightingForceState'{} ->
	  v_msg_LightingForceState(Msg, ['LightingForceState'],
				   TrUserData);
      #'GpsActionRsp'{} ->
	  v_msg_GpsActionRsp(Msg, ['GpsActionRsp'], TrUserData);
      #'GpsActionReq'{} ->
	  v_msg_GpsActionReq(Msg, ['GpsActionReq'], TrUserData);
      #'GpsSample'{} ->
	  v_msg_GpsSample(Msg, ['GpsSample'], TrUserData);
      #'SensorSampleReq'{} ->
	  v_msg_SensorSampleReq(Msg, ['SensorSampleReq'],
				TrUserData);
      #'TimeResp'{} ->
	  v_msg_TimeResp(Msg, ['TimeResp'], TrUserData);
      #'TimeReq'{} ->
	  v_msg_TimeReq(Msg, ['TimeReq'], TrUserData);
      #'VideoUploadResp'{} ->
	  v_msg_VideoUploadResp(Msg, ['VideoUploadResp'],
				TrUserData);
      #'VideoUploadReq'{} ->
	  v_msg_VideoUploadReq(Msg, ['VideoUploadReq'],
			       TrUserData);
      #'SensorSample'{} ->
	  v_msg_SensorSample(Msg, ['SensorSample'], TrUserData);
      #'DeviceActionReq'{} ->
	  v_msg_DeviceActionReq(Msg, ['DeviceActionReq'],
				TrUserData);
      #'DeviceAlarm'{} ->
	  v_msg_DeviceAlarm(Msg, ['DeviceAlarm'], TrUserData);
      #'SoftwareUpdateReq'{} ->
	  v_msg_SoftwareUpdateReq(Msg, ['SoftwareUpdateReq'],
				  TrUserData);
      #'ConfigRespDone'{} ->
	  v_msg_ConfigRespDone(Msg, ['ConfigRespDone'],
			       TrUserData);
      #'UnusedConfigReq'{} ->
	  v_msg_UnusedConfigReq(Msg, ['UnusedConfigReq'],
				TrUserData);
      #'LoginResp'{} ->
	  v_msg_LoginResp(Msg, ['LoginResp'], TrUserData);
      #'Envelope'{} ->
	  v_msg_Envelope(Msg, ['Envelope'], TrUserData);
      #'ErrorResp'{} ->
	  v_msg_ErrorResp(Msg, ['ErrorResp'], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-dialyzer({nowarn_function,v_msg_KVPair/3}).
v_msg_KVPair(#'KVPair'{key = F1, sValue = F2,
		       lValue = F3, bValue = F4},
	     Path, _) ->
    v_type_string(F1, [key | Path]),
    if F2 == undefined -> ok;
       true -> v_type_string(F2, [sValue | Path])
    end,
    if F3 == undefined -> ok;
       true -> v_type_int64(F3, [lValue | Path])
    end,
    if F4 == undefined -> ok;
       true -> v_type_bool(F4, [bValue | Path])
    end,
    ok;
v_msg_KVPair(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, 'KVPair'}, X, Path).

-dialyzer({nowarn_function,v_msg_ConfigResp/3}).
v_msg_ConfigResp(#'ConfigResp'{pair = F1}, Path,
		 TrUserData) ->
    v_msg_KVPair(F1, [pair | Path], TrUserData), ok;
v_msg_ConfigResp(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, 'ConfigResp'}, X, Path).

-dialyzer({nowarn_function,v_msg_X509UpdateReq/3}).
v_msg_X509UpdateReq(#'X509UpdateReq'{x509UpdateURL = F1,
				     x509Update = F2, httpsPort = F3},
		    Path, _) ->
    v_type_string(F1, [x509UpdateURL | Path]),
